    false,nt"url": null,nt"notes": "This annual narrative report for Rachel
    Carson National Wildlife Refuge outlines Refuge accomplishments during the 2002
    calendar year. The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which focused on the master plan, management plan, compliance with environmental
    mandates, research and investigations, and other. Refuge administration is outlined;
    information about personnel, youth and volunteer programs, funding, safety and other
    items is covered. Habitat management is also covered; subjects include wetlands,
    forests, grasslands, other habitats, and fire management. The wildlife section of
    the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, other migratory birds, game mammals,
    marine mammals, other resident wildlife, scientific collection, marking and bird
    banding, and disease prevention and control. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, fishing,
    wildlife observation, and law enforcement. The equipment and facilities section
    of the report provides information about new construction, rehabilitation, major
    maintenance, equipment utilization and replacement, communication systems, computer
    systems, and energy conservation.",nt"license_title": "License Not Specified",nt"extras":
